<!DOCTYPE html>
<html lang="pt-BR">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>B4DLUCKY - Redirecionando...</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <link rel="preconnect" href="https://fonts.googleapis.com" />
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin />
    <link
      href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;700;900&display=swap"
      rel="stylesheet"
    />
    <style>
      body {
        font-family: "Inter", sans-serif;
      }
    </style>
    <style>
      body {
        font-family: Arial, sans-serif;
        height: 100vh;
        background-color: #222;
        color: #d9d9d9;
        overflow: hidden;
      }
      h1,
      h2,
      h3 {
        margin-right: auto;
      }
      .captcha-box {
        width: 450px;
        height: 70px;
        display: flex;
        justify-content: center;
        align-items: center;
        border: 1px solid #555;
        background-color: #222;
        padding-bottom: 0px !important;
        padding-top: 0px !important;
        padding-left: 0px !important;
        padding-right: 0px !important;
        margin-right: auto;
        margin-left: auto;
        margin-top: 20px;
      }
      .captcha-box img {
        width: 50px;
        height: 50px;
        margin-right: 15px;
        border-radius: 10%;
        margin-left: 5px;
      }
      .captcha-box img.crossors {
        width: 35px;
        height: 35px;
        border-radius: 50%;
        margin-right: 12.5px !important;
        margin-left: 12.5px;
      }
      .captcha-box p {
        font-size: 18px;
        margin-right: auto;
      }
      .captcha-box.undone p {
        margin-left: 5px;
      }
      .captcha-box.done p.a,
      .captcha-box.loading p.a {
        display: none;
      }
      .captcha-box.undone p.bfail,
      .captcha-box.loading p.bfail {
        display: none;
      }
      .captcha-box.undone img.crossors,
      .captcha-box.loading img.crossors {
        display: none;
      }

      .captcha-box.undone p.p-c,
      .captcha-box.done p.p-c {
        display: none;
      }

      input[type="checkbox"] {
        display: none;
      }
      div.captcha-box.undone input[type="checkbox"] + label {
        background: #222;
        border: 2px solid #ddd;
        height: 24px;
        width: 24px;
        display: inline-block;
        padding: 0 0 0 0px;
        cursor: pointer;
        margin-left: 15px;
        margin-right: 5px;
      }
      div.captcha-box.done input[type="checkbox"].checked + label {
        display: none;
      }
      .swal2-modal {
        width: 700px !important;
      }
      .c {
        align-items: center;
        flex-direction: column;
        justify-content: center;
        display: flex;
        padding-left: 10%;
        padding-top: 5%;
        padding-right: 10%;
        overflow: auto;
      }
      .captcha-box.loading .loader {
        border: 2.5px solid #f3f3f3; /* Light grey */
        border-top: 2.5px solid #888; /* Blue */
        border-radius: 50%;
        width: 24px;
        height: 24px;
        animation: spin 1s linear infinite;
        margin-left: 12.5px;
        margin-right: 15px;
      }

      @keyframes spin {
        0% {
          transform: rotate(0deg);
        }
        100% {
          transform: rotate(360deg);
        }
      }
    </style>
  </head>

    <div
      class="min-h-screen flex items-center justify-center p-4 bg-cover bg-center bg-neutral-900"

      <div

        <h1 class="text-4xl md:text-5xl font-black text-white tracking-tighter">
          B4DLUCKY
        </h1>
        <div class="captcha-box undone">
          <div class="loader"></div>
          <p class="p-c loading-text">Carregando...</p>
          <input
            type="checkbox"
            name="xcaptcha"
            value="valuable"
            id="xcaptcha"
            autocomplete="off"
          /><label for="xcaptcha"></label>
          <img
            class="crossors"
            src="https://cdn-icons-png.flaticon.com/512/4225/4225690.png"
          />
          <p class="bfail">Falha <span id="fail-message"></span></p>
          <p class="a">Clique para provar que você é azarado.</p>
          <img
            src="https://img.stickers.cloud/packs/f7565fbf-0efe-4252-8caf-1018d9eff75d/png/09d04177-92f1-4125-8279-c436fb451d9d.png"
            alt="Logo de azarado"
          />
        </div>
        <div class="mt-8 hidden xmain">
          <p class="text-xl text-neutral-300">
            Você será redirecionado em instantes...
          </p>
          <p class="text-5xl font-bold text-cyan-400 mt-4" id="countdown">3</p>
        </div>
      </div>
    </div>

      const countdownElement = document.getElementById("countdown");
      let timeLeft = 3;
      let uncaptcha = true;

      async function load(msg, time) {
        return new Promise((r) => {
          document.querySelector(".loading-text").textContent =
            msg && msg !== "" ? msg + "..." : "Verificando...";
          document.querySelector(".captcha-box").classList.add("loading");
          document.querySelector(".captcha-box").classList.remove("done");
          document.querySelector(".captcha-box").classList.remove("undone");
          setTimeout(() => {
            document.querySelector(".captcha-box").classList.remove("loading");
            r();
          }, time);
        });
      }

      const countdownInterval = setInterval(() => {
        if (uncaptcha) return;
        timeLeft--;
        if (countdownElement) {
          countdownElement.textContent = timeLeft;
        }
        if (timeLeft <= 0) {
          clearInterval(countdownInterval);
          window.location.href = window.b4dlucky.link;
        }
      }, 1000);
      load("Carregando", 2000).then(() => {
            document.querySelector(".captcha-box").classList.add("undone");
            document
              .querySelector("#xcaptcha")
              .addEventListener("click", () => {
                load("Verificando", 2000).then(() => {
                      uncaptcha = false;
                      document.querySelector(".captcha-box").classList.add("hidden");
                      document.querySelector(".xmain").classList.remove("hidden");
                })
              });
      });
    </script>
